import Layout2 from './src/components/Layout2';

class App extends Component {
  render() {
     return(
      <View style={{backgroundColor: 'grey'}}>
        <View style={{backgroundColor: 'red', shadowRadius:5,}}>
        <Header1/>
        </View>
        <View>
        <Layout2/>
        </View>
        <Header3/>
        <ScrollView>
        <Card/>
        </ScrollView>
        </View>
    )
  }
};

export default App;
